import React from 'react';
import './Blog.css';

import Navbar from '../components/Navbar.jsx';
import Footer from '../components/Footer.jsx';

const list = ['a', 'b', 'c'];


function Blog(){
    return(
        <div>
            <Navbar/>

            const SimpleList = () => (
            <ul>
            {list.map(function(item) {
                return <li key={item}>{item}</li>;
            })}
  </ul>
);

            <Footer/>
        </div>
    );
}

export default Blog;
